import React, { useState } from "react";

export const App = (props) => {
  const [cep, setCep] = useState("");
  const [addressCep, setAddressCep] = useState({})

  const handleSubmit = async (e) => {
      e.preventDefault();
      const res = await fetchAddress(cep);
      setAddressCep(res);
      return res;
  };

  const fetchAddress = async (cep) => {
    try {
        const response = await fetch(`http://localhost:3001/address/${cep}`)

        return await response.json()
    } catch (error) {
        return `cep ${cep} ${error}`;
    }
};
  return (
    <form onSubmit={handleSubmit}>
      <label className="cep">
        <h1>
          Cep:
        </h1>
        <div>{addressCep.cep}</div>
        <div>{addressCep.logradouro}</div>
        <div>{addressCep.complemento}</div>
        <div>{addressCep.bairro}</div>
        <div>{addressCep.localidade}</div>
        <div>{addressCep.uf}</div>
        <div>{addressCep.ibge}</div>
        <div>{addressCep.gia}</div>
        <div>{addressCep.ddd}</div>
        <div>{addressCep.siafi}</div>
        <input
          type="text"
          value={cep}
          onChange={e => setCep(e.target.value)}
        />
      </label>
      <input type="submit" value="Submit" />
    </form>
  );
}

export default App;
